import React from 'react'
import './footer.css'

const quickLinks01 = [
    {
        path: '#' ,
        display : 'Marketing'
    },
    {
        path: '#' ,
        display : 'Analytics'
    },
    {
        path: '#' ,
        display : 'Commerce'
    },
]

const Footer = () => {
  return (
    <footer className="footer">
        <div className="container">
            <div className="footer__wrapper">
                <div className="footer__logo">
                    <h2>E-D-I CONSEIL</h2>
                    <p className="description">Grow with us</p>

                    <p className="small__text description">Lorem ipsum dolor sit amet consectetur, adipisicing elit. A perferendis ducimus deserunt, provident tempora in tempore esse nobis dicta saepe?</p>
                </div>

                <div className="foorer__quick-links">
                    <div className="quick__link-title">Solution</div>
                    <ul className="quick__links"></ul>
                </div>
            </div>
        </div>
    </footer>
  )
}

export default Footer
